// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Sidebar from './Sidebar';
import 'bootstrap/dist/css/bootstrap.min.css';

export default function App() {
  return (
    <Router>
      <div className="d-flex">
        <Sidebar />
        <div className="content p-4" style={{ flex: 1 }}>
          <Routes>
            <Route path="/" element={<div>Home Page</div>} />
            <Route path="/bubble-sort" element={<div>Bubble Sort Visualization</div>} />
            <Route path="/merge-sort" element={<div>Merge Sort Visualization</div>} />
            <Route path="/quick-sort" element={<div>Quick Sort Visualization</div>} />
            <Route path="/insertion-sort" element={<div>Insertion Sort Visualization</div>} />
            <Route path="/selection-sort" element={<div>Selection Sort Visualization</div>} />
          </Routes>
        </div>
      </div>
    </Router>
  );
}
